class FlexFieldManager:
    def __init__(self):
        self.flex_fields = {}

    def add_flex_field(self, field_name: str, field_value: str) -> bool:
        if len(field_value) > 255:  # Example length limit
            logger.error(f"Flex field {field_name} exceeds maximum length")
            return False
        self.flex_fields[field_name] = field_value
        return True

    def get_flex_field(self, field_name: str) -> Optional[str]:
        return self.flex_fields.get(field_name)

